import { Routes, Route,  } from "react-router-dom";
import {  AuthProvider } from "./contexts/auth";
import Login from "./paginas/Login";

function Routers() {


  return (
    <AuthProvider>
      <Routes>
        <Route path="/" element={<Login />} />

      </Routes>
    </AuthProvider>
  );
}

export default Routers;
